import { Container, Row, Col } from "react-bootstrap";

const HomePage = () => {
  return (
    <Container fluid>
      <Row>
        <Col>
          <h1>Home</h1>
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
